import React from "react";
import Header from "../components/Header";

const Home = () => {
  return (
    <div>
      <Header />
      <div className="content">
        <div className="home-title">
          <h1>Louis Vanoise</h1>
          <h3>Développeur Web Front-end</h3>
          <p>Spécialisé en React</p>
        </div>
        <div className="home-items"></div>
      </div>
    </div>
  );
};

export default Home;
